&lt;p&gt;sea and...... what? - fans of the Who will know  - here's the story - it wasn't any of the Who that I was reminded of when I lined this one up - it was Paul Weller and the revamped mod style of skinny cardy over a t-shirt - and mod style brings us back to the Who's Sea and Sand&lt;br /&gt;
&lt;br /&gt;
&amp;quot;I am the face,&lt;br /&gt;
She has to know me,&lt;br /&gt;
I'm dressed up better than anyone&lt;br /&gt;
Within a mile&amp;quot;&lt;br /&gt;
&lt;br /&gt;
don't think designer stubble was part of the look though ;-)&lt;/p&gt;

