&lt;p&gt;23rd October 2010 at London Irish Centre, London.&lt;br /&gt;
&lt;br /&gt;
Return to Camden Town Festival, &lt;a href="http://www.returntocamden.org/" rel="nofollow"&gt;www.returntocamden.org/&lt;/a&gt;.&lt;br /&gt;
&lt;br /&gt;
Country: Ireland. Style: Irish Traditional Folk.&lt;br /&gt;
&lt;br /&gt;
Lineup: Matt Molloy (flute), John Carty (fiddle), Arty McGlynn (g).&lt;br /&gt;
&lt;br /&gt;
Between them they have been part of most of the better known Irish traditional bands of recent decades. From Roscommon, Matt Molloy has been a member of the Bothy Band, Planxty and the Chieftains. Arty McGlynn from Tyrone has been in Patrick Street, Planxty, Four Men and a Dog, and De Danann. John Carty was born in London (now living in Roscommon), and is also in At the Racket and Patrick Street.&lt;br /&gt;
More information: &lt;a href="http://www.mattmolloy.com/" rel="nofollow"&gt;www.mattmolloy.com/&lt;/a&gt;, &lt;a href="http://www.johncartymusic.com/" rel="nofollow"&gt;www.johncartymusic.com/&lt;/a&gt;.&lt;/p&gt;

